import { Routes, Route } from 'react-router-dom'
import Home from "./pages/Home"
import Details from './pages/Details';

const App = () => {
  return (
    <Routes> 
        <Route path='/home' element={<Home/>} />     
        <Route path='/details' element={<Details/>} />     
    </Routes>
  ); 
}

export default App
